import { Link } from "react-router-dom";

const Home = () => <h1>Home</h1>;
const Profile = () => <h1>Profile</h1>;

function SideBar () {
    return (
        <div>
            <div className="sidebar">
                <ul className="navigation">
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/profile">Profile</Link>
                    </li>
                </ul>
            </div>
        </div>
    )
}

export default SideBar
